import React from 'react'
import {SidebarData} from '../Sidebar/SidebarData';
import Banner from '../Banner/Banner';

class Panasonic extends React.Component{
    render(){
        let item = SidebarData.find(item => item.title === "Panasonic Internship");
        return(
            <div className='panasonic'>
                <Banner 
                imageSrc = {item.imageSrc}
                thisIs = "my Panasonic Internship"
                descript= "Panasonic Avionics Web Development Intern from October 2019 to April 2020. Was unfortunately cut short due to the COVID-19 pandemic."/>

            </div>
        )
    }
}

export default Panasonic;
